    public function mapOrderStates ()
    {
        $default_order_states_mapping = [
            2 => [6],
            3 => [1, 9],
            4 => [2],
            6 => [3, 4],
        ];
        $order_states_mapping = [];
        foreach ($this->module->sellermania_order_states as $sm_order_key => $sm_order_state) {
            $map_value = json_decode(Configuration::get($sm_order_key));
            if (!empty($map_value) and is_array($map_value)) {
                foreach ($map_value as $v) {
                    if (!isset($order_states_mapping[$v])) {
                        $order_states_mapping[$v] = [];
                    }
                    $order_states_mapping[$v][] = $sm_order_state["sm_status"];
                }
            } else {
                foreach ($default_order_states_mapping as $ps_os_id => $sm_os_ids) {
                    foreach ($sm_os_ids as $sm_os_id) {
                        if ($sm_os_id == $sm_order_state["sm_status"]) {
                            if (!isset($order_states_mapping[$ps_os_id])) {
                                $order_states_mapping[$ps_os_id] = [];
                            }
                            $order_states_mapping[$ps_os_id][] = $sm_order_state["sm_status"];
                        }
                    }
                }
            }

        }

        return $order_states_mapping;
    }

